al warnings","            # such as \".zip appears to use backslashes as path separators\".","            unzip -q -d \"$dir\" \"$zip\" || [ $? -le 1 ]","        fi","    )","}","","# path, verify (0/1), urls...","# the gpg signature is assumed to be url+.sig","download_and_unpack() {","    local path do_verify urls","    path=\"$1\"","    do_verify=\"$2\"","    urls=(\"${@:3}\")","    local tmp name","    tmp=$(mkdtemp)","    name=\"$(basename \"${urls[0]}\")\"","","    check_tools curl","    if [[ $name =~ \\.tar\\.xz$ ]]; then","        check_tools tar xz","    elif [[ $name =~ \\.7z$ ]]; then","        check_tools 7z","    elif [[ $name =~ \\.zip$ ]]; then","        if ! command -v 7z &>/dev/null; then","            check_tools unzip","        fi","    fi","","    log \"Downloading and unpacking ${urls[0]}\"","    download \"$tmp/$name\" \"$do_verify\" \"${urls[@]}\"","    if [[ $name =~ \\.tar\\.xz$ ]]; then","        tar --strip-components=1 -C \"$tmp\" -Jxf \"$tmp/$name\"","    elif [[ $name =~ \\.tar\\.gz$ ]]; then","        tar --strip-components=1 -C \"$tmp\" -xf \"$tmp/$name\"","    else","        mkdir \"$tmp\"/target","        unpack_zip \"$tmp/$name\" \"$tmp\"/target","","        local files=(\"$tmp\"/target/*)","        if [[ \"${#files[@]}\" -eq 1 && -d \"${files[0]}\" ]]; then","            # Single directory at the top of the archive,","            # as is common with .tar archives. Move it out.","            find \"$tmp\"/target -mindepth 2 -maxdepth 2 -exec sh -c \"exec mv \"\\$@\" '$tmp'\" sh {} \\+","            rmdir \"$tmp\"/target/*","        else","            find \"$tmp\"/target -mindepth 1 -maxdepth 1 -exec sh -c \"exec mv \"\\$@\" '$tmp'\" sh {} \\+","        fi","        rmdir \"$tmp\"/target","    fi","    rm \"$tmp/$name\"","    mv \"$tmp\" \"$path\"","}","","# path, urls...","download_and_unpack_with_verify() {","    download_and_unpack \"$1\" 1 \"${@:2}\"","}","","# path, urls...","download_and_unpack_without_verify() {","    downl